Begin helsAssScript

if ( MenuMode == 1 )
	return
endif

if ( OnDeath == 1 )
	set helsassdead to ( helsassdead + 1 )
endif

if ( helsassdead == 3 )
	if ( GetJournalIndex TR_Assassins < 90 )
		Journal TR_Assassins 90
	endif
endif

if ( GetJournalIndex TR_Assassins > 85 )
	return
endif

if ( GetJournalIndex TR_Assassins < 85 )
	if ( GetDisabled == 0 )
		Disable
	endif
endif

if ( GetJournalIndex TR_Assassins == 85 )
	if ( GetDisabled == 1 )
		Enable
	endif
endif

End helsAssScript
